import pandasclass RowFilter:    def filter(self, data: pandas.DataFrame, insulation_none=True, header=True):        if insulation_none:            data = self._insulation_none_filter(data)        if header:            data = self._header_filter(data)        return data    def _insulation_none_filter(self, data: pandas.DataFrame):        coloumn = "Insulation Type"        if coloumn in data.columns:            return data[data[coloumn].astype(str) != "None"]        return data    def _header_filter(self, data: pandas.DataFrame):        return data.iloc[1:, :]class ColoumnFilter:    def filter(self, data: pandas.DataFrame):        data = self._col_selection_filter(data)        return data    def _col_selection_filter(self, data: pandas.DataFrame):        coloumns = ["Size", "Count", "Area", "Surface Area"]        for coloumn in coloumns:            if coloumn not in data.columns:                return data        return data[coloumns]